import React from "react";

const TestData = [
  {
    id: 1,
    user: "Nunt",
    title: "title",
    content: "content",
    timestap: 24 / 11 / 2020,
  },
  {
    id: 2,
    user: "Ploy",
    title: "title",
    content: "content",
    timestap: 25 / 11 / 2020,
  },
];

export default TestData;
